import React from 'react';
import { Wrapper } from '../Wrapper/index';
import { Layout } from 'antd';

export function home() {

  return (
      <Wrapper>
          <Layout>
              <h1>
                  THIS IS HOME
              </h1>
          </Layout>
      </Wrapper>
  )
}
